import React, { FC } from 'react';
import styles from './Home.module.scss';

interface HomeProps {}

const Home: FC<HomeProps> = () => {
  return(
    <main className={styles.Main}>
      <div> <h5>Hey there, welcome to my website.</h5>
      Here you can find everything on me and my knowledge.
      </div>
      <div>I recently graduated from John Bryce College and I'm excited to be part of a community of developers for a better world.
          The main technologies I learned:
          </div>
          <table>
            <th>Frontend</th>
            <th>Backend</th>
            <th>DB & Others</th>
            <tr>
              <td>
                <ul>
                  <li>Angular</li>
                </ul>

              </td>
              <td></td>
              <td></td>
            </tr>
          </table>
    </main>
  );
}

export default Home;
